import './App.css';
import Accomplishments from "./components/Accomplishments";
import Bio from "./components/Bio";
import Skills from './components/Skills';


import { Link, Router } from 'react-router-dom'
function App() {
  return (
    <div className="App">
      <header className="navbar">
      <span><Link to='/Bio'>Bio</Link></span>
      <span><Link to='/Skills'>Skills</Link></span>
      <span><Link to='/Accomplishments'>Accomplishments</Link></span>
      </header>
      <h1 className="title">Louis Thomas</h1>

      <Router path='/Bio' exact component={Bio}/>
      <Router path='/Skills' exact component={Skills}/>  
      <Router path='/Accomplishments' exact component={Bio}/> 



    </div>
  );
}

export default App;
